import { Box, Flex, Heading, Stack } from '@chakra-ui/core';

const GroceryForm = () => (
  <Stack spacing="2rem">
    <Heading as="h1" size="2xl">
      Add Items
    </Heading>
    <Flex></Flex>
  </Stack>
);

export default GroceryForm;
